import ItemBest from '../pageComponents/itembest/ItemBest.js'
import JourneyComponent from '../pageComponents/journey/JourneyComponent.js'
import MissionComponent from '../pageComponents/mission/MissionComponent.js'
import FooterComponent from '../footerComponent/footer/FooterComponent'
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';

const HomeScreen = () => {
  const[listItemFashion,setListItem] = useState([]); 
  const[replaceListItem, setReplace] = useState([]);

    useEffect(() => {
        axios.get("/bag").then(res => {
            setListItem(res.data);
        }).catch(err => console.log(err))
    },[listItemFashion.length])

    useEffect(() => {
      axios.get("/card/").then(res => {
        setReplace(res.data);
        console.log(replaceListItem)
      }).catch(err => console.log(err))
    },[replaceListItem.length])


  return(
        <div>
          <Banner />
